import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import SearchBar from '../../components/Common/SearchBar/Searchbar';
import CustomModel from '../../components/Common/DialogBox/DialogBox';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    width: theme.breakpoints.values.lg,
    maxWidth: '100%',
    margin: '0 auto',
    padding: theme.spacing(3),
  },
  textFieldStyle: {
    width: '100%',
  },
}));

function SkinCare() {
  const classes = useStyles();
  const [addModelOpen, setAddModelOpen] = React.useState(false);
  return (
    <div className={classes.root}>
      <SearchBar modelOpen={() => setAddModelOpen(!addModelOpen)} />
      <CustomModel
        open={addModelOpen}
        close={() => setAddModelOpen(!addModelOpen)}
        Title=' Add Skin Care Items'
      >
        <TextField
          className={classes.textFieldStyle}
          placeholder='Enter Recipe Name'
          variant='outlined'
        />
      </CustomModel>
    </div>
  );
}

export default SkinCare;
